import React from "react";
import {
  Cabecalho,
  Botao,
  SeparadorDiv,
  SeparadorDivDois,
} from "./estiloHome";

function Home() {
  return (
    <div>
      <header>
        <Cabecalho>
          <view style={style.container}>
            <image sou/>
          </view>
          <SeparadorDivDois></SeparadorDivDois>
          <Botao>Sobre </Botao>
          <SeparadorDiv></SeparadorDiv>
          <Botao>Contato</Botao>
          <SeparadorDiv></SeparadorDiv>
          <Botao>Admin</Botao>
        </Cabecalho>
      </header>
      <body></body>
    </div>
  );
}

export default Home;
